  "title": {
    "nb": "Miljøvedtaksregisteret"
  },
  "description": {
    "nb": "Miljøvedtaksregisteret er et offentlig register som gir allmenheten fri tilgang til enkeltvedtak og forskrifter på miljøområdet. Enkeltvedtak knyttet til rovvilt, områdevern, utenlandske treslag, prioriterte arter og utvalgte naturtyper er blant vedtakene som skal registreres i Miljøvedtaksregisteret, jf. forskrift 14. juni 2013 nr. 643 om Miljøvedtaksregisteret.Forvaltningsmyndigheten som har truffet enkeltvedtaket har plikt til å registrere vedtaket i Miljøvedtaksregisteret. Enkeltvedtak skal registreres senest tre virkedager etter at parten er underrettet om vedtaket. Registrering i Miljøvedtaksregisteret erstatter ikke offentlige myndigheters plikt til å kunngjøre og varsle etter forvaltningsloven, naturmangfoldloven og andre lover. Miljødirektoratet har laget en veileder til registrering av vedtak i registeret og denne veilederen finner du her.I Miljøvedtaksregisterets kartløsning kan du søke opp enkeltvedtakene ut fra hvor vedtakene er registrert. Slik stedfesting representerer vedtaket og vil ikke nødvendigvis være eksakt. Vedtak vil være stedfestet ved et representasjonspunkt og/eller i nærmere bestemte kommuner.Miljødirektoratet drifter Miljøvedtaksregisteret og tilbyr brukerstøtte. Spørsmål og feilmeldinger kan sendes på e-post til miljovedtak@miljodir.no. Enkeltvedtak etter forurensningsloven finnes ikke i Miljøvedtaksregisteret, men ligger på Norske utslipp (www.norskeutslipp.no)."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eMiljøvedtaksregisteret er et offentlig register som gir allmenheten fri tilgang til enkeltvedtak og forskrifter på miljøområdet. Enkeltvedtak knyttet til rovvilt, områdevern, utenlandske treslag, prioriterte arter og utvalgte naturtyper er blant vedtakene som skal registreres i Miljøvedtaksregisteret, jf. \u003ca href\u003d\"https://lovdata.no/dokument/SF/forskrift/2013-06-14-643\" rel\u003d\"nofollow\"\u003eforskrift 14. juni 2013 nr. 643 om Miljøvedtaksregisteret\u003c/a\u003e.\u003c/p\u003e\u003cp\u003eForvaltningsmyndigheten som har truffet enkeltvedtaket har plikt til å registrere vedtaket i Miljøvedtaksregisteret. Enkeltvedtak skal registreres senest tre virkedager etter at parten er underrettet om vedtaket. Registrering i Miljøvedtaksregisteret erstatter ikke offentlige myndigheters plikt til å kunngjøre og varsle etter forvaltningsloven, naturmangfoldloven og andre lover. Miljødirektoratet har laget en veileder til registrering av vedtak i registeret og denne veilederen finner du \u003ca href\u003d\"http://www.miljodirektoratet.no/miljovedtak/\" rel\u003d\"nofollow\"\u003eher\u003c/a\u003e.\u003c/p\u003e\u003cp\u003eI Miljøvedtaksregisterets kartløsning kan du søke opp enkeltvedtakene ut fra hvor vedtakene er registrert. Slik stedfesting representerer vedtaket og vil ikke nødvendigvis være eksakt. Vedtak vil være stedfestet ved et representasjonspunkt og/eller i nærmere bestemte kommuner.\u003c/p\u003e\u003cp\u003eMiljødirektoratet drifter Miljøvedtaksregisteret og tilbyr brukerstøtte. Spørsmål og feilmeldinger kan sendes på e-post til \u003ca href\u003d\"mailto:miljovedtak@miljodir.no\" rel\u003d\"nofollow\"\u003emiljovedtak@miljodir.no\u003c/a\u003e. Enkeltvedtak etter forurensningsloven finnes ikke i Miljøvedtaksregisteret, men ligger på Norske utslipp (\u003ca href\u003d\"http://www.norskeutslipp.no/\" rel\u003d\"nofollow\"\u003ewww.norskeutslipp.no\u003c/a\u003e).\u003c/p\u003e"
  },
